import React from 'react';
import { Grid, Card, CardContent, Typography, Table, TableBody, TableCell, TableHead, TableRow } from '@mui/material';

const GroupStage = () => {
    const groups = [
        { name: 'Groupe A', teams: ['Équipe 1', 'Équipe 2', 'Équipe 3', 'Équipe 4'] },
        { name: 'Groupe B', teams: ['Équipe 5', 'Équipe 6', 'Équipe 7', 'Équipe 8'] },
        // Ajouter les autres groupes ici
    ];

    return (
        <div style={{ padding: "20px" }}>
            <Typography variant="h4" gutterBottom>Phases de groupes</Typography>
            <Grid container spacing={4}>
                {groups.map((group, index) => (
                    <Grid item xs={12} md={6} key={index}>
                        <Card>
                            <CardContent>
                                <Typography variant="h5">{group.name}</Typography>
                                <Table>
                                    <TableHead>
                                        <TableRow>
                                            <TableCell>Équipe</TableCell>
                                        </TableRow>
                                    </TableHead>
                                    <TableBody>
                                        {group.teams.map((team, idx) => (
                                            <TableRow key={idx}>
                                                <TableCell>{team}</TableCell>
                                            </TableRow>
                                        ))}
                                    </TableBody>
                                </Table>
                            </CardContent>
                        </Card>
                    </Grid>
                ))}
            </Grid>
        </div>
    );
};

export default GroupStage;
